import './ExpenseItem.css';

function ExpenseItem(ramm){
 

return(
<div className='expense-item'>
  
    <div>{ramm.date.toISOString()}</div>
    <div className='expense-item_description'><h2>{ramm.title}</h2></div>
    <div className='expense-item_price'>{ramm.amount}</div>

</div>
);
}

export default ExpenseItem;
